import 'expo-dev-client';
import React from 'react';
import { StyleSheet, Text, SafeAreaView, View } from 'react-native'


export default function App() {
  return (
    <SafeAreaView style={{ color: "blue"}}>
      <View>
        <Text style={{ color: "blue"}}>Hello</Text>
      </View>
    </SafeAreaView>
  );
}
